import React from 'react'
import Marker from './Marker';

const Markers = ({markers}) => {
    return (
        
            
            markers.map((marker) => 
                <Marker
                text={marker.address}
                lat={marker.latitude}
                lng={marker.longitude}
                />
            )
        
    )
};

export default Markers
